import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import './NavBer.css'




class NavBer extends Component {
    render() {
        return (
             
   <div className="Navbar">
  <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home" style={{color:"whitesmoke"}}>COVIT-19 SURVEY FORM</Navbar.Brand>
    <Nav className="NavLink">
      <Nav.Link href="#home"style={{color:"white"}}>Home</Nav.Link>
      <Nav.Link href="#survey"style={{
          color:"white",
          background:"gray"
      }}>Survey</Nav.Link>
      <Nav.Link href="#liveStats">COVIT-19 Live Stats</Nav.Link>
      <Nav.Link href="#about">About Us</Nav.Link>
      <Nav.Link href="#login">Login</Nav.Link>
      <Nav.Link href="#registration">Registration Now</Nav.Link>

      
    </Nav>
    
  </Navbar>
 

  <div/>
            </div>
        );
    }
}

export default NavBer;
